import React from "react";
import { BrowserRouter as Router, Route, Switch, Link } from "react-router-dom";
import Page from "./Page";

export default function App() {
  let [yy, Setyy] = React.useState([
    { id: 1, title: "test", type: false },
    { id: 2, title: "item", type: true },
    { id: 3, title: "post", type: false }
  ]);

  let btn = (id) => {
    console.log(id);
  };

  return (
    <Router>
      <div className="App">
        {yy.map((g) => (
          <div key={g.id}>
            <li>
              {g.id} {g.title}
            </li>
            <Link to={`/detail/${g.id}`}>
              <button onClick={() => btn(g.id)}>click</button>
            </Link>
          </div>
        ))}
        <Switch>
          <Route
            path="/detail/:id"
            render={(props) => (
              <Page
                item={yy.find(
                  (item) => item.id.toString() === props.match.params.id
                )}
              />
            )}
          />
        </Switch>
        <Page />
      </div>
    </Router>
  );
}
